		"text": "In case anyone's curious, this isn't ideology. This is because I had to figure out why my data didn't match the prediction. Those rats I mentioned? Yeah, my lab. And lab rats are a really pure genetic monoculture, and they STILL don't fit the two peak model well.\n\n/24"
